import axios from 'axios';

function Recipe(){
    return(
        <div></div>
    );
}

export function requestGeneratedRecipe(ingredientsList: Array<string>){

    var URL = "http://172.31.81.52:8000/getRecipe?"

    ingredientsList.forEach(element => {
        URL += `&i=${element}`
    });
    
    axios.get(URL)
    .then(res => {
      return res
    })
}


export default Recipe;
